problem:
Let  \[ f(x) =
\begin{cases}
-\sqrt[3]x & \text{if } x \geq 0,\\
x^2& \text{if } x <0.
\end{cases}
\]Compute $f(f(f(f(512)))).$

solution:
We begin by adding 2 to both sides of the equation, \begin{align*} 23&=x^4+\frac{1}{x^4}
\\\Rightarrow\qquad 25&=x^4+\frac{1}{x^4}+2
\\\Rightarrow\qquad 25&=x^4+2(x^2)\left(\frac{1}{x^2}\right)+\frac{1}{x^4}
\\\Rightarrow\qquad 25&=\left(x^2+\frac{1}{x^2}\right)^2
\end{align*}  So $x^2+\frac{1}{x^2}$ is equal to either $5$ or $-5$. Since $x^2+\frac{1}{x^2}$ is the sum of two squares, it cannot be negative.  So $x^2+\frac{1}{x^2}=\boxed{5}$.

We must find the radius of the circle in order to find the area. We are told that points $A$ and $B$ are the endpoints of a diameter, so we use the distance formula to find the length of the diameter.

\begin{align*}
\sqrt{(-1-3)^2+(-2-2)^2} &= \sqrt{16 + 16} \\
&= 4\sqrt{2}
\end{align*}Since the diameter has a length of $4\sqrt{2}$, the radius must have length $2\sqrt{2}$. Therefore, the answer is $(2\sqrt{2})^2\pi = \boxed{8\pi}$.

Since $8=\left(\frac{1}{2}\right)^{-3}$ the equation can be rewritten as $\left(\frac{1}{2}\right)^{-3(4x-6)}=\left(\frac{1}{2}\right)^{x+5}$. From this equation, we see that $-3(4x-6)=x+5$. Simplifying we get, \begin{align*}
-12x+18&=x+5\\
\Rightarrow -13x+18&=5\\
\Rightarrow -13x&=-13\\
\Rightarrow x&=\boxed{1}.
\end{align*}

Instead of expanding the entire product, we can look only at terms that will multiply to give $x^3$.  We know that $$x^3=x^3\cdot 1=x^2\cdot x=x\cdot x^2=1\cdot x^3.$$Knowing this, the $x^3$ term in the expansion will be the sum of these four terms: $$(6x^3)(4)+(4x^2)(3x)+(-7x)(3x^2)+(-5)(6x^3).$$We simplify to find: \begin{align*}
&(6x^3)(4)+(4x^2)(3x)+(-7x)(3x^2)+(-5)(6x^3)\\
&\qquad=24x^3+12x^3-21x^3-30x^3\\
&\qquad=\boxed{-15}x^3
\end{align*}

problem:
The graph of $y=ax^2+bx+c$ is given below, where $a$, $b$, and $c$ are integers.  Find $a$.

[asy]
size(140);
Label f;

f.p=fontsize(4);

xaxis(-3,3,Ticks(f, 1.0));

yaxis(-4,4,Ticks(f, 1.0));

real f(real x)

{

return x^2+2x-1;

}

draw(graph(f,-2.7,.7),linewidth(1),Arrows(6));
[/asy]

